this.getCalendarData = function (start, end) {
  if (typeof start === "undefined") {
    start = end = new Date();
  }
  var q = format (
    "'rdf:type' == 'mnd-s:RegistrationToPassOffice' && 'v-s:datePlan' == [{1},{2}]",
    start.toJSON(),
    end.toJSON()
  );
  return veda.Backend.query({
    ticket: veda.ticket,
    query: q
  })
  .then(function (queryResult) {
    var uris = queryResult.result;

    var promises = uris.map(function(uri) {
      return new veda.IndividualModel(uri).load();
    });
    return Promise.all(promises).then(function(result) {
      var label;
      var eventObjs = result.reduce(function(acc, event) {
        if (event.hasValue("v-s:deleted", true)) {
          return acc;
        };
        if (!event.hasValue("mnd-s:hour") || !event.hasValue("mnd-s:hasMinutesIntervalForPass")) {
          return acc;
        };
        event["mnd-s:hasMinutesIntervalForPass"].forEach(function(interval) {
          var dueDate = event["v-s:datePlan"][0];
          dueDate.setHours(event["mnd-s:hour"][0]);
          switch (true) {
            case (interval.id === "d:minutesInterval_0_15") :
              dueDate.setMinutes(0);
            break;
            case (interval.id === "d:minutesInterval_15_30") :
              dueDate.setMinutes(15);
            break;
            case (interval.id === "d:minutesInterval_30_45") :
              dueDate.setMinutes(30);
            break;
            case (interval.id === "d:minutesInterval_45_59") :
              dueDate.setMinutes(45);
            break;
          };
          dueDate = dueDate.valueOf();

          if (acc[dueDate]) {
            acc[dueDate] = event.hasValue("mnd-s:isReservedPeriodForPass", true)? acc[dueDate] + 6 : acc[dueDate] + 1;
          } else {
            acc[dueDate] = event.hasValue("mnd-s:isReservedPeriodForPass", true)? 6 : 1;
          };
        })
        return acc;
      }, {});

      var events = [];
      for (var date in eventObjs) {
        var className;
        var title;

        if (eventObjs[date] == 1) {
          className = "fc-primary";
          title = eventObjs[date] + " запись";
        } else if (eventObjs[date] == 2 || eventObjs[date] == 3) {
          className = "fc-primary";
          title = eventObjs[date] + " записи";
        } else if (eventObjs[date] == 4) {
          className = "fc-warning";
          title = eventObjs[date] + " записи";
        } else if (eventObjs[date] == 5) {
          className = "fc-warning";
          title = eventObjs[date] + " записей";
        } else {
          className = "fc-danger";
          title = eventObjs[date] + " записей";
        };

        events.push({
          "title": title,
          "className": className,
          "start": +date,
          "end": +date + 15 * 60 * 1000
        });
      }
      return events;
    });
  });
}

